import React from 'react';
import './StudentExam.css';
import ArrowForwardIosRoundedIcon from '@mui/icons-material/ArrowForwardIosRounded';

export default function StudentExam() {

  function myFunction() {
    document.getElementById("myDropdown").classList.toggle("show");
  }

  // Close the dropdown menu if the user clicks outside of it
  window.onclick = function(event) {
    if (!event.target.matches(".dropbtn")) {
      var dropdowns = document.getElementsByClassName("dropdown-content");
      var i;
      for (i = 0; i < dropdowns.length; i++) {
        var openDropdown = dropdowns[i];
        if (openDropdown.classList.contains("show")) {
          openDropdown.classList.remove("show");
        }
      }
    }
  };

  return (
    <>
      <div class="na-style dropdown">
        <button onclick="myFunction()" class="na-title dropbtn">Recipes of North America</button>
        <nav>
          <ul id="myDropdown" class="na-list dropdown-content">
            <li><a class="na-anchor">United States</a></li>
            <li><a class="na-anchor">Canada</a></li>
            <li><a class="na-anchor">Mexico</a></li>
            <li><a class="na-anchor">Honduras</a></li>
          </ul>
        </nav>
      </div>

      <h2 class="gb-title">Recipes of Great Brittain</h2>
      <div>
        <nav>
          <ul class="gb-list">
            <li><a class="gb-anchor">England</a></li>
            <li><a class="gb-anchor">Scotland</a></li>
            <li><a class="gb-anchor">Ireland</a></li>
            <li><a class="gb-anchor">Wales</a></li>
          </ul>
        </nav>
      </div>
    </>
  );
}
